import React from "react";
import { useLocation } from "react-router-dom";
import jsPDF from "jspdf";
import "jspdf-autotable";
import { useState } from "react";

const DetailInvoice = () => {
  const location = useLocation();
  const {
    id,
    To,
    Phone,
    Address,
    Products,
    totalAmount,
    InvoiceNo,
    PosNo,
    CustomerNo,
    paid,
    GstNo,
    Unit,
  } = location.state;
  const [selectedUnits, setSelectedUnits] = useState(Products.map(() => "."));
  const [gstRate, setGstRate] = useState(18); // Default GST rate set to 18%

  const handleUnitChange = (index, value) => {
    const newUnits = [...selectedUnits];
    newUnits[index] = value;
    setSelectedUnits(newUnits);
  };

  // Update the GST rate based on user selection
  const handleGstChange = (event) => {
    const selectedGstRate = parseInt(event.target.value);
    setGstRate(selectedGstRate);
  };

  // const currentDate = new Date().toLocaleDateString();
  const currentDate = new Date();

  const options = { month: "long", day: "numeric", year: "numeric" };
  const formattedDate = currentDate.toLocaleDateString("en-US", options);
  const totalAmountNumber = parseFloat(totalAmount);
  const salesTaxRate = 0.18;
  const salesTaxAmount = parseFloat(
    (totalAmountNumber * salesTaxRate).toFixed(2)
  );
  const netAmount = parseFloat((totalAmountNumber + salesTaxAmount).toFixed(2));

  console.log(selectedUnits);
  const paidImageUrl =
    "data:image/jpeg;base64,";

  const backgroundImageUrl = paid ? paidImageUrl : null;

  const generateInvoicePDF = () => {
    const doc = new jsPDF();

    if (backgroundImageUrl) {
      const img = new Image();
      img.src = backgroundImageUrl;
      img.onload = function () {
        addContent(doc, img);
      };
    } else {
      addContent(doc);
    }
  };

  const addContent = (doc, img) => {
    const width = doc.internal.pageSize.getWidth();
    const height = doc.internal.pageSize.getHeight();
    const imgWidth = 60; // Adjust the width of the image
    const imgHeight = 138; // Adjust the height of the image
    const x = (width - imgWidth) / 2; // Center horizontally
    const y = height - imgHeight - -20; // Position near the bottom with some margin

    const gstRateDecimal = gstRate / 100;
    const gstAmount = totalAmountNumber * gstRateDecimal;

    // Calculate net amount
    const netAmount = totalAmountNumber + gstAmount;

    const addBackgroundImage = () => {
      if (img) {
        doc.addImage(img, "JPEG", x, y, imgWidth, imgHeight, "", "FAST");
      }
    };

    addBackgroundImage();

    doc.text("DELIVERY CHALLAN", 105, 80, { align: "center" });
    doc.setFontSize(12);
    doc.text(`Challan NO. ${InvoiceNo}`, 20, 45);
    doc.text(`${formattedDate}`, 20, 50);
    doc.setFont("helvetica", "bold");
    doc.text(`${To}`, 20, 55);
    doc.setFont("helvetica", "normal");
    doc.text(`${Address}`, 20, 60);
    doc.text(`Unit: ${Unit}`, 20, 65);

    // Split the text into parts
    const preText = "Thank you very much for your valued P.O# ";
    const postText = ". We are pleased to deliver the following items.";
    const startX = 15;
    const startY = 95;

    // Add the preText
    doc.text(preText, startX, startY);

    // Measure the width of the preText
    const preTextWidth = doc.getTextWidth(preText);

    // Set font to bold and add PosNo
    doc.setFont("helvetica", "bold");
    doc.text(PosNo, startX + preTextWidth, startY);

    // Measure the width of the PosNo
    const PosNoWidth = doc.getTextWidth(PosNo);

    // Set font back to normal and add postText
    doc.setFont("helvetica", "normal");
    doc.text(postText, startX + preTextWidth + PosNoWidth, startY);

    doc.autoTable({
      startY: 100,
      head: [["SR. #", "DESCRIPTION", "QTY"]],
      body: Products.map((product, index) => [
        index + 1,
        product.name,
        `${product.qty} ${selectedUnits[index]}`,
        // product.qty,
        // selectedUnits[index],
        console.log("select", selectedUnits),
      ]),
    });

    doc.text(
      "Kindly acknowledge the receipt.",
      20,
      doc.autoTable.previous.finalY + 30
    );
    doc.text("Thanks with Regards,", 20, doc.autoTable.previous.finalY + 35);
    doc.text(
      "FOR: Al-MEHRIA ENGINEERING WORKS",
      20,
      doc.autoTable.previous.finalY + 80
    );

    doc.addPage();
    addBackgroundImage();
    doc.setFont("helvetica", "bold");

    doc.text("Commercial Invoice", 105, 80, { align: "center" });

    doc.setFont("helvetica", "normal");

    doc.text(`INVOICE NO. ${InvoiceNo}`, 20, 45);
    doc.text(`${formattedDate}`, 20, 50);
    doc.setFont("helvetica", "bold");
    doc.text(`${To}`, 20, 55);
    doc.setFont("helvetica", "normal");
    doc.text(`${Address}`, 20, 60);
    doc.setFont("helvetica", "bold");

    doc.text(`P.O# ${PosNo}`, 20, 70);

    doc.autoTable({
      startY: 100,
      head: [["SR.", "DESCRIPTION", "U.PRICE", "QTY.", "T.AMOUNT"]],
      body: Products.map((product, index) => [
        index + 1,
        product.name,
        product.price.toFixed(2),
        // product.qty,
        // selectedUnits[index],
        `${product.qty} ${selectedUnits[index]}`,
        (product.qty * product.price).toFixed(2),
      ]),
    });

    doc.autoTable({
      startY: doc.autoTable.previous.finalY + 5,
      body: [
        ["TOTAL AMOUNT", `Rs. ${totalAmountNumber.toFixed(2)}/-`],

        [`SALES TAX AMOUNT`, `Rs. ${gstAmount.toFixed(2)}/-`], // Display GST amount
        ["NET AMOUNT", `Rs. ${netAmount.toFixed(2)}/-`], // Display net amount
      ],
      columns: [{ dataKey: "description" }, { dataKey: "amount" }],
      columnStyles: {
        0: { halign: "left" }, // First column (index 0) is the description
        1: { halign: "right" }, // Second column (index 1) is the amount
      },
      didParseCell: function (data) {
        if (data.row.section === "body") {
          if (data.column.dataKey === "description") {
            data.cell.styles.halign = "left";
          }
          if (data.column.dataKey === "amount") {
            data.cell.styles.halign = "right";
          }
        }
      },
    });

    doc.text(
      "FOR: Al-MEHRIA ENGINEERING WORKS",
      20,
      doc.autoTable.previous.finalY + 60
    );

    doc.addPage();
    addBackgroundImage();

    const pageWidth = doc.internal.pageSize.getWidth();

    // Calculate the starting X position for right-aligned text
    const text1 = `Al- Mehria Engineering NTN# 2876495-1`;
    const text2 = `GST# 3277876212202`;

    const text1Width = doc.getTextWidth(text1);
    const text2Width = doc.getTextWidth(text2);

    const text1X = pageWidth - text1Width - 10; // 20 is the right margin
    const text2X = pageWidth - text2Width - 15; // 20 is the right margin

    // New text to be right aligned
    const rightText = `${To} NTN# ${CustomerNo}`;
    const rightTextWidth = doc.getTextWidth(rightText);
    const rightTextX = pageWidth - rightTextWidth - 10; // 20 is the right margin

    const gstText = `GST# ${GstNo}`;
    const gstTextWidth = doc.getTextWidth(gstText);
    const gstTextX = pageWidth - gstTextWidth - 15; // 20 is the right margin

    doc.text("SALES TAX INVOICE", 105, 90, { align: "center" });

    doc.text(`INVOICE NO. ${InvoiceNo}`, 20, 45);
    doc.text(`${formattedDate}`, 20, 50);
    doc.setFont("helvetica", "bold");
    doc.text(`${To}`, 20, 55);
    doc.setFont("helvetica", "normal");
    doc.text(`${Address}`, 20, 60);
    doc.setFont("helvetica", "bold");

    doc.text(`P.O# ${PosNo}`, 20, 75);

    doc.setFont("helvetica", "normal");

    doc.text(text1, text1X, 45);
    doc.text(text2, text2X, 50);
    doc.text(rightText, rightTextX, 70); // Right-aligned text for NTN#
    doc.text(gstText, gstTextX, 75); // Right-aligned text for GST#

    doc.autoTable({
      startY: 105,
      head: [["SR.", "DESCRIPTION", "U.PRICE", "QTY.", "TOTAL AMOUNT"]],
      body: Products.map((product, index) => [
        index + 1,
        product.name,
        product.price.toFixed(2),
        // product.qty,
        `${product.qty} ${selectedUnits[index]}`,
        (product.qty * product.price).toFixed(2),
      ]),
    });

    doc.autoTable({
      startY: doc.autoTable.previous.finalY + 5,
      body: [
        ["TOTAL AMOUNT", `Rs. ${totalAmountNumber.toFixed(2)}/-`],
        ["SALES TAX AMOUNT", `Rs. ${gstAmount.toFixed(2)}/-`],
        ["NET AMOUNT", `Rs. ${netAmount.toFixed(2)}/-`],
      ],
      columns: [{ dataKey: "description" }, { dataKey: "amount" }],
      columnStyles: {
        0: { halign: "left" }, // First column (index 0) is the description
        1: { halign: "right" }, // Second column (index 1) is the amount
      },
      didParseCell: function (data) {
        if (data.row.section === "body") {
          if (data.column.dataKey === "description") {
            data.cell.styles.halign = "left";
          }
          if (data.column.dataKey === "amount") {
            data.cell.styles.halign = "right";
          }
        }
      },
    });

    doc.text(
      "FOR: Al-MEHRIA ENGINEERING WORKS",
      20,
      doc.autoTable.previous.finalY + 60
    );

    doc.save(`Invoice_${InvoiceNo}.pdf`);
  };

  return (
    <div className="p-8 bg-white rounded-lg shadow-md max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold mb-6">Invoice Details</h2>
      <div className="mb-4">
        <h3 className="text-lg font-semibold">NTN No:</h3>
        <p>{CustomerNo}</p>
      </div>
      <div className="mb-4">
        <h3 className="text-lg font-semibold">Company Name:</h3>
        <p>{To}</p>
      </div>
      <div className="mb-4">
        <h3 className="text-lg font-semibold">Invoice No:</h3>
        <p>{InvoiceNo}</p>
      </div>
      <div className="mb-4">
        <h3 className="text-lg font-semibold">GST No:</h3>
        <p>{GstNo}</p>
      </div>
      <div className="mb-4">
        <h3 className="text-lg font-semibold">Po No:</h3>
        <p>{PosNo}</p>
      </div>

      <div className="mb-4">
        <h3 className="text-lg font-semibold">Phone:</h3>
        <p>{Phone}</p>
      </div>
      <div className="mb-4">
        <h3 className="text-lg font-semibold">Address:</h3>
        <p>{Address}</p>
      </div>

      <div className="mb-4">
        <h3 className="text-lg font-semibold">Products:</h3>
        <table className="w-full border border-gray-300 rounded">
          <thead>
            <tr className="bg-gray-100">
              <th className="px-4 py-2">S.No</th>
              <th className="px-4 py-2">Description</th>
              <th className="px-4 py-2">U.Price</th>
              <th className="px-4 py-2">Quantity</th>
              <th className="px-4 py-2">Total Amount</th>
            </tr>
          </thead>
          <tbody>
            {Products.map((product, index) => (
              <tr key={index}>
                <td className="border px-4 py-2">{index + 1}</td>
                <td className="border px-4 py-2">{product.name}</td>
                <td className="border px-4 py-2">{product.price.toFixed(2)}</td>
                <td className="border px-4 py-2">
                  {product.qty}
                  <select
                    value={selectedUnits[index]}
                    onChange={(e) => handleUnitChange(index, e.target.value)}
                    className=""
                  >
                    <option>.</option>
                    <option>Nos</option>
                    <option>Sets</option>
                  </select>
                </td>
                <td className="border px-4 py-2">
                  {(product.qty * product.price).toFixed(2)}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="mb-4">
        <h3 className="text-lg font-semibold">Total Amount:</h3>
        <p>{totalAmountNumber.toFixed(2)} Rs</p>
      </div>

      <div className="mb-4">
        <h3 className="text-lg font-semibold">Select GST Rate:</h3>
        <select
          className="border px-4 py-2"
          value={gstRate}
          onChange={handleGstChange}
        >
          <option value={15}>15%</option>
          <option value={18}>18%</option>
        </select>
      </div>

      <div className="mb-4">
        <h3 className="text-lg font-semibold">Status:</h3>
        <p>{paid ? "Paid" : "Pending"}</p>
      </div>
      <button
        className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
        onClick={generateInvoicePDF}
      >
        Download PDF
      </button>
    </div>
  );
};

export default DetailInvoice;
